import { Link } from "react-router-dom";

export const Header = () => {

    return(
        <header>
        {/* <!-- Navigation --> */}
        <h1><Link tu="/" className="home">GamesPlay</Link></h1>
        <nav>
            <Link tu="/catalog">All games</Link>
            {/* <!-- Logged-in users --> */}
            <div id="user">
                <Link tu="/createPage">Create Game</Link>
                <Link tu="/logout">Logout</Link>
            </div>
            {/* <!-- Guest users --> */}
            <div id="guest">
                <Link tu="/login">Login</Link>
                <Link tu="/register">Register</Link>
            </div>
        </nav>
    </header>
    );
}
